import React from 'react'
import './Navbar.css'

class Navbar extends React.Component{

    executa(){
        document.getElementById("navLogo").innerHTML='ola';
        console.log('ola');
    }

    render(){
        return (
            <div className="navBar">

                    <div className="containerLogo">
                        <div onMouseOver={this.executa} className="navLogo" ><p>RELEASE</p></div>
                    </div>

                    <div className="containerItems">
                        <div className="navItems"><p onClick={console.log('ola')}>Contact</p></div>
                        <div className="navItems"><p>Work</p></div>
                        <div className="navItems"><p>Home</p></div>
                    </div>
            </div>  
        )
    }
}

export default Navbar
